import React from "react";

const ListTasks = () => {
  const tasks = [
    { id: 1, description: "Task 1" },
    { id: 2, description: "Task 2" },
    { id: 3, description: "Task 3" },
  ];

  return (
    <>
      <table className="mt-5 text-center">
        <thead>
          <tr>
            <th>Description</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task) => (
            <tr key={task.id}>
              <td>{task.description}</td>
              <td>
                <button>Edit</button>
              </td>
              <td>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default ListTasks;
